SELECT AVG("title"."kind_id") as agg_0 FROM "aka_name" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id" LEFT OUTER JOIN "info_type" ON "movie_info_idx"."info_type_id" = "info_type"."id"  WHERE "movie_keyword"."movie_id" >= 1029663 AND "kind_type"."kind" NOT LIKE '%movie%' AND "title"."production_year" >= 2007.413959863825 AND "keyword"."id" >= 84039 AND "aka_name"."surname_pcode" LIKE '%B6%3%' AND "info_type"."info" = '%birth notes%' AND "char_name"."id" IS NOT NULL AND "company_name"."id" IS NOT NULL;
SELECT COUNT(*) as agg_0, MIN("cast_info"."nr_order") as agg_1 FROM "title" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "movie_link" ON "title"."id" = "movie_link"."movie_id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id"  WHERE "movie_link"."link_type_id" = 5 AND "kind_type"."kind" IN ('video game', 'tv series') AND "movie_link"."id" BETWEEN 16965 AND 29846 AND "movie_companies"."company_id" BETWEEN 29 AND 69 AND ("cast_info"."note" NOT LIKE '%Adler)%' OR "cast_info"."note" LIKE '%(ar%chive%') AND "movie_info"."movie_id" IS NOT NULL AND "company_name"."id" IS NOT NULL AND "movie_info_idx"."movie_id" IS NOT NULL;
